import React from "react";
import styled from "styled-components";



const CompletedDiv = styled.div`{
cursor: pointer;
color: ${props => props.status.complete ? "#865829" : props.status.special ? "pink" : "white"};
}`


const Track = ({ track, handleToggle }) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
    console.log(track.status)
  }
  return (

    <CompletedDiv
      id={track.id}
      name="track"
      value={track.id}
      onClick={handleClick}
      status={track.status.map}
    >
      {track.title}

    </CompletedDiv >

  );
};

export default Track;
